(401, 126, 'description', 'Musically, Jones\'s bass-heavy deconstructions use vocals in much the same way as Aïsha Devi or Visionist have recently, helium-high and stretched beyond anything recognisably human. They squeal and coo like a choir of robo-seraphs, often bleeding into the music\'s bleeps. So far it\'s been an all-female and fairly ephemeral affair, but on "Ruby Fifths," Teklife\'s Heavee adds a weighty dimension to the mix. His staccato phrasing brings the track closer to footwork, too, which creeps through the mist of Jones\'s delicate choral sprays. '),
