(413, 132, 'description', 'Windowlicker" is a song by electronic music artist Richard D. James, released under his Aphex Twin pseudonym. It was released as a single on 22 March 1999 through Warp Records. The single peaked at number 16 on the UK Singles Chart, becoming his highest-charting song, and was later voted, by fans, as Warp Records\' most popular song, for its Warp20 compilation.\r\n\r\nThe artwork for the single was created by Chris Cunningham, with additional work by The Designers Republic. Cunningham also directed the song\'s music video, which was nominated for the Brit Award for Best British Video.'),
